import React from 'react'
import './Home.css'
export default function Home() {
    var backgroundStyle = {
        width: "100%",
        height: "400px",
        backgroundImage: "url(" + + ")"
    };

    return (
        <div className="Home">
            <div style={backgroundStyle}>

            <h1> Welcome to the MemLearn </h1>

            <h3>Repetitive, but promising!</h3>
            <h3>A simple & exciting Tool for learning new Languages</h3>
            </div>
        </div>
    )

}
